    @staticmethod
    def plot(oFile=None):
        nm = GeoDataFrameDemosA.nantesMetropole()
        nantes = GeoDataFrameDemosA.villeDeNantes()
        ileDeNantes = GeoDataFrameDemosA.ileDeNantes()
        intraBoulevardsNantes = GeoDataFrameDemosA.intraBoulevardsNantes()
        intraPeripheriqueNantes = GeoDataFrameDemosA.intraPeripheriqueNantes()
        psmv = GeoDataFrameDemosA.psmv()

        concession_amenagement_pirmil = GeoDataFrameDemosA.concession_amenagement_pirmil()
        zac_basse_ile = GeoDataFrameDemosA.zac_basse_ile()
        zac_pirmil = GeoDataFrameDemosA.zac_pirmil()

        # MAPPING
        minx, miny, maxx, maxy = nm.total_bounds

        fig, ax = plt.subplots(figsize=(0.7 * 8.26, 1 * 8.26))
        nm.boundary.plot(ax=ax, color="red")
        nantes.boundary.plot(ax=ax, color="blue")
        ileDeNantes.boundary.plot(ax=ax, color="green")
        intraBoulevardsNantes.boundary.plot(ax=ax, color="orange")
        intraPeripheriqueNantes.boundary.plot(ax=ax, color="brown")
        psmv.boundary.plot(ax=ax, color="magenta")

        concession_amenagement_pirmil.boundary.plot(
            ax=ax, color="cyan", hatch=".")
        zac_basse_ile.boundary.plot(ax=ax, color="yellow")
        zac_pirmil.boundary.plot(ax=ax, color="dimgrey")

        ax.axis("off")
        ax.axis([minx, maxx, miny, maxy])
        if oFile is None:
            fig.tight_layout()
            plt.show()
        else:
            plt.savefig(oFile, bbox_inches="tight")
        plt.close(fig)


